  "privacy_content": "<h2>Integritetspolicy</h2> <p>Denna integritetspolicy är tillämplig vid användning av PharmaLedgers Association produkt för elektronisk produktinformation. </p> <h2>Kontakter</h2><ul class=\"list-space\" role=\"list\"><li role=\"listitem\"><b>a) Identitet och kontaktuppgifter för den personuppgiftsansvarige eller de gemensamt personuppgiftsansvariga </b><p>Personuppgiftsansvarig för dina uppgifter är PharmaLedger Association.</p></li><li role=\"listitem\"><b>b) Kontakter till dataskyddsombudet</b><p>PharmaLedger Associations dataskyddsombud kan kontaktas på dpo@pharmaledger.org.</p></li></ul><h2>Vilka personuppgifter vi använder</h2><p>Vi samlar endast in de tekniska uppgifter som krävs för att leverera den elektroniska bipacksedeln. Detta inkluderar din IP-adress och tekniska identifierare för den enhet och webbläsare som du använder för att komma åt vår applikation.</p> <p><em> I detalj samlar vi in följande dataelement: </em></p><ul><li><p><em>Åtkomst till mobila enheter.</em> Vi kan begära åtkomst eller tillstånd till vissa funktioner från din mobila enhet, inklusive din mobila enhets kamera och andra funktioner. Om du vill ändra vår åtkomst eller våra behörigheter kan du göra det i enhetens inställningar.</p></li><li><p><em>Data om mobila enheter.</em> Vi samlar automatiskt in enhetsinformation (såsom din mobila enhets ID, modell och tillverkare), operativsystem, versionsinformation och systemkonfigurationsinformation, enhets- och applikationsidentifieringsnummer, webbläsartyp och version, hårdvarumodell Internetleverantör och/eller mobiloperatör och IPadress (Internet Protocol) (eller proxyserver). Om du använder våra applikationer kan vi också samla in information om det telefonnät som är kopplat till din mobila enhet, din mobila enhets operativsystem eller plattform, vilken typ av mobil enhet du använder, din mobila enhets unika enhets-ID och information om de funktioner i våra applikationer som du har öppnat.</p></li></ul><h2>Varför vi samlar in dina personuppgifter</h2><h3>Ändamål</h3><p>Vi samlar in dina tekniska uppgifter i syfte att förse dig med en elektronisk bipacksedel för ditt läkemedel. </p><p>Vi kan därför förlita oss på följande rättsliga grunder för att behandla dina personuppgifter:</p><ul><li><p><b>Fullgörande av ett avtal.</b> Vi kan behandla dina personuppgifter när vi anser att det är nödvändigt för att uppfylla avtalsenliga skyldigheter gentemot dig, inklusive att tillhandahålla våra tjänster eller på din begäran innan vi ingår ett avtal med dig. </p></li><li><p><b>Rättsliga skyldigheter.</b> Vi kan behandla dina uppgifter om vi anser att det är nödvändigt för att uppfylla våra rättsliga skyldigheter, t.ex. för att uppfylla våra skyldigheter enligt hälso- och sjukvårdslagstiftning och folkhälsolagstiftning.</p></li></ul><h2>Med vilka vi delar dina personuppgifter</h2><p> Medlemsföretag och tjänsteleverantörer från tredje part.</p><p>Vi delar dina uppgifter med tredjepartsleverantörer, tjänsteleverantörer, entreprenörer eller agenter (\"tredje parter\") som utför tjänster för oss eller på våra vägnar och behöver tillgång till sådan information för att utföra sitt arbete. Vi har avtal med våra tredje parter, som är utformade för att skydda dina personuppgifter. Det innebär att de inte får göra något med dina personuppgifter om vi inte har instruerat dem att göra det. De kommer inte heller att dela dina personuppgifter med någon annan organisation än oss. De åtar sig också att skydda de uppgifter de innehar för vår räkning och att behålla dem under den period vi instruerar dem. De kategorier av tredje parter som vi kan komma att dela personuppgifter med är följande: </p><ul><li><p>Läkemedelstillverkare (medlemsföretag)</p></li><li><p>Tekniska tjänsteleverantörer</p></li></ul><h2>Hur länge vi lagrar dina personuppgifter</h2><p>PharmaLedger Association lagrar endast dina tekniska uppgifter så länge som det är nödvändigt för att behandla din begäran om bipacksedel i upp till 30 dagar. </p><p>Din läkemedelstillverkare kommer också att lagra dina uppgifter under en definierad tidsperiod som bestäms av deras policy för datalagring, för mer information om denna lagring vänligen kontakta din läkemedelstillverkare.</p><h2>Om du inte ger oss dina personuppgifter</h2><p>Om du väljer att inte lämna dina tekniska data till oss kommer vi inte att kunna uppfylla din begäran om bipacksedel.</p><h2>Dina rättigheter</h2><p>Om du har några frågor om dina personuppgifter enligt GDPR, t.ex. en begäran om åtkomst till eller radering av dina uppgifter, kan du kontakta oss på dpo@pharmaledger.org.</p><p>Vi kommer att behandla sådana förfrågningar inom 30 dagar.</p><h2> Återkallande av samtycke</h2><p>Om du har några frågor om dina personuppgifter enligt GDPR, t.ex. en begäran om åtkomst till eller radering av dina uppgifter, kan du kontakta oss på dpo@pharmaledger.org. </p><p>Vi kommer att behandla sådana förfrågningar inom 30 dagar.</p><h2>Automatiserat beslutsfattande</h2><p>Vi använder inte något automatiserat beslutsfattande i vårt tillhandahållande av denna tjänst till dig.</p><h2>Internationell överföring av personuppgifter</h2><p>Om din läkemedelstillverkare kräver att vi överför dina uppgifter utanför Europeiska unionen använder vi standardavtalsklausuler för att skydda dina uppgifter.</p><h2>Hur man klagar</h2><p>Om du har några frågor om dina personuppgifter enligt GDPR, t.ex. en begäran om åtkomst till eller radering av dina uppgifter, kan du kontakta oss på dpo@pharmaledger.org.</p><p>Vi kommer att behandla sådana förfrågningar inom 30 dagar. Du kan också kontakta din lokala tillsynsmyndighet om du anser att dina rättigheter inte tillgodoses.</p>",
