  "terms_content": "<h2>Villkor för PharmaLedger Associations webbplats och applikation för elektronisk produktinformation </h2><p>Genom att besöka eller använda PharmaLedger Associations webbplats och applikation för elektronisk produktinformation (\"Tjänsterna\") samtycker du till att vara bunden av dessa villkor (\"Villkoren\"). Du får inte åtkomst kan inte använda Tjänsterna om du inte samtycker till dessa Villkor. Tjänsterna drivs av PharmaLedger Association (\"Association\") och är avsedda att användas av individer som söker information om sin medicinering. Ett flerpartsnätverk levererar Tjänsterna, och din läkemedelstillverkare tillhandahåller den produktinformation som visas genom Tjänsterna. Föreningen agerar som personuppgiftsansvarig för denna information. </p><h2>Användning av tjänsterna </h2><p>Du samtycker till att endast använda tjänsterna för lagliga ändamål och på ett sätt som inte inkräktar på tredje parts rättigheter eller begränsar eller förhindrar tredje parts användning och åtnjutande av tjänsterna. Sådan begränsning eller hinder inkluderar, utan begränsning, beteende som är olagligt, eller som kan trakassera eller orsaka oro eller besvär för någon person, och överföring av obscent eller stötande innehåll eller störningar av det normala flödet av dialog inom tjänsterna. </p><h2>Immateriella rättigheter </h2><p>Innehållet i Tjänsterna, inklusive, men inte begränsat till, text, grafik, bilder och programvara, tillhör förbundet eller dess licensgivare och medlemsföretag och skyddas av upphovsrätt och andra immaterialrättsliga lagar. Du får inte använda något innehåll från Tjänsterna för något kommersiellt ändamål utan uttryckligt skriftligt medgivande från förbundet. </p><h2>Ansvar</h2><p>Förbundet lämnar inga garantier av något slag, uttryckliga eller underförstådda, avseende driften av Tjänsterna eller den information, det innehåll, de material eller de produkter som ingår i Tjänsterna. Förbundet ansvarar inte för några skador av något slag som uppstår till följd av användningen av tjänsterna, inklusive, men inte begränsat till, direkta, indirekta, tillfälliga, straffande och följdskador. </p><h2>Tillämplig lag </h2><p>Dessa villkor och din användning av tjänsterna ska regleras av och tolkas i enlighet med lagstiftningen i Schweiz och eventuella tvister ska lösas i domstolarna i Basel, Schweiz. </p><h2>Ändringar av villkoren </h2><p>Förbundet förbehåller sig rätten att när som helst ändra dessa Villkor, och du är ansvarig för att kontrollera dessa Villkor regelbundet för eventuella ändringar. Din fortsatta användning av Tjänsterna efter det att eventuella ändringar av Villkoren har gjorts utgör ditt godkännande av de reviderade Villkoren.</p><p><br></p>",
