  "about_content": "<h2>Om denna app</h2><p>Den här appen tillhandahålls av PharmaLedger®. Den har utvecklats gemensamt av patientorganisationer, läkemedelsföretag och teknikexperter.</p><p>Den gör det möjligt för användare av appen att se information om sitt läkemedel genom att skanna streckkoden på produktförpackningen.</p><p>Den information som visas tillhandahålls av innehavaren av produktens marknadsföringstillstånd.</p><h2>Om PharmaLedger</h2><p>PharmaLedger® är varumärket för PharmaLedger Association (PLA).</p><p>PLA är en global icke-vinstdrivande, neutralt förbund. Förbundets syfte är att skapa och främja ett tillitsfullt digitalt ekosystem inom hälsooch sjukvården.</p><p>Förbundet främjar samarbete inom hälso- och sjukvårds- och life science-sektorerna, samt främjar innovationer och deras genomförande till ömsesidig nytta för patienter och andra intressenter.</p>",
