  "help_modal_subtitle": "Vanliga frågor",
  "help_content": "<div><p><b><h2>Vad är EPI?</h2></b></p><p> <b>EPI</b> är en förkortning för <b>elektronisk produktinformation.</b> Det är en elektronisk version av den bipacksedel i pappersformat som vanligtvis finns i en läkemedelsförpackning. I vissa fall kan <b>EPI</b> ha ersatt bipacksedeln i pappersformat.</p><p><b><h2>Vad är PharmaLedger?</h2></b></p><p>PharmaLedger Association (PLA) är ett ideellt förbund baserad i Schweiz med syfte att möjliggöra och främja ett ekosystem för digitalt förtroende inom hälso- och sjukvården genom en standardiserad och betrodd open source-plattform. PLA främjar samarbete och påskyndar innovation och adoption för att uppnå ömsesidiga fördelar inom hälsooch sjukvård och life science-domäner för patienter och andra intressenter. PLA bildades 2022 för att fortsätta arbetet med PharmaLedger-projektet, ett treårigt projekt som finansieras av Europeiska kommissionen och läkemedelsindustrin och som syftar till att bevisa värdet av blockkedjelösningar. Ytterligare information finns på https://pharmaledger.org.</p><p><b><h2>Vad är DataMatrix?</h2></b></p><p>Det är en typ av streckkod på din produktförpackning. Det är en svartvit streckkod med en fyrkantig ruta och ser ut ungefär så här:<br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Hur använder jag appen?</h2></b></p><p>Följ instruktionerna på <b>appens startsida...</b> den visar en bild av var du hittar <b>DataMatrix</b> på förpackningen. När du har hittat <b>DataMatrix</b>, klickar du på knappen \"Skanna <b>DataMatrix</b>\". Låt applikationen använda kameran så att <b>DataMatrix</b> kan skannas. Använd kameran för att fokusera på <b>DataMatrix</b>. När förpackningen har skannats framgångsrikt visas <b>EPI</b> Du kan klicka på knappen \"+\" för att få mer information.</p><p><b><h2>Varför ger min DataMatrix-scanning inget resultat?</h2></b></p><p>Det finns flera orsaker till att <b>DataMatrix</b> på din förpackning kanske inte ger ett EPI-resultat. En av anledningarna kan vara kamerans fokus. Försök att skanna koden på en väl upplyst plats så att koden syns tydligt på skärmen. Om du har svårt att hålla handen stadigt kan du försöka använda ett bord som stöd för händerna.</p></div>",
